    <!-- Método para confirmar exclusão que chama a função ""ExcluirJogador via url"" -->
    <script>
        function ConfirmarExclusao(id) {

            $("".modal"").modal();

            $("".btnExcluir"").on('click', function () {

                $.ajax({
                    url: 'Times/ExcluirJogador',
                    method: 'POST',
